function migrateLP(uint amountLP) internal returns(uint256 token0,uint256 token1) {

    IERC20(LP_OLD).transferFrom(msg.sender,address(this),amountLP);
    IERC20(LP_OLD).approve(ROUTER_V2,amountLP);

    return IUniswapV2Router01(ROUTER_V2).removeLiquidity(
        WETH,
        OLD_CELL,
        amountLP,
        0,
        0,
        address(this),
        block.timestamp + 5000
    );

}

function exactInputSingle(ExactInputSingleParams memory params)
    external
    payable
    override
    nonReentrant
    returns (uint256 amountOut)
{
    // use amountIn == Constants.CONTRACT_BALANCE as a flag to swap the entire balance of the contract
    bool hasAlreadyPaid;
    if (params.amountIn == Constants.CONTRACT_BALANCE) {
        hasAlreadyPaid = true;
        params.amountIn = IERC20(params.tokenIn).balanceOf(address(this));
    }

    amountOut = exactInputInternal(
        params.amountIn,
        params.recipient,
        params.sqrtPriceLimitX96,
        SwapCallbackData({
            path: abi.encodePacked(params.tokenIn, params.fee, params.tokenOut),
            payer: hasAlreadyPaid ? address(this) : msg.sender
        })
    );
    require(amountOut >= params.amountOutMinimum);
}

